var title_f27_46_28395="Cytokines radiation exposure";
var content_f27_46_28395=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F66044&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F66044&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cytokine doses after radiation exposure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Cytokine",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adult dose*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Precautions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G-CSF",
"       </td>",
"       <td>",
"        5 &micro;g/kg per day SQ until ANC",
"&gt;1000/microL",
"       </td>",
"       <td>",
"        Sickle cell disease, significant coronary art disease,",
"ARDS&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pegylated G-CSF",
"       </td>",
"       <td>",
"        6 mg SQ as a single dose",
"       </td>",
"       <td>",
"        as with G-CSF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        GM-CSF",
"       </td>",
"       <td>",
"        250 &micro;g/m2/day SQ until ANC &gt;1000/microL",
"       </td>",
"       <td>",
"        as with G-CSF",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     G-CSF: granulocyte colony-stimulating factor; GM-CSF: granulocyte-macrophage colony-stimulating factor; ARDS: acute respiratory distress syndrome; ANC: absolute neutrophil count.",
"     <br>",
"      * Recommended doses of G-CSF and GM-CSF are similar for adults, pregnant women, and children. Dose for pegylated G-CSF for adolescents &gt;45 kg is the same as that for adults.",
"      <br>",
"       &bull; Consider discontinuation of cytokines if pulmonary infiltrates develop at the time of neutrophil recovery.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Waselenko JK, MacVittie TJ, Blakely WF, et al. Medical management of the acute radiation syndrome: Recommendations of the strategic national stockpile radiation working group. Ann Int Med 2004; 140:1039. Copyright &copy; 2004 American College of Physicians.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
