var title_f27_46_28396="Modified RECIST for hepatocellular carcinoma";
var content_f27_46_28396=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F58792&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F58792&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Modified RECIST for hepatocellular carcinoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Response assessment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Target lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CR",
"       </td>",
"       <td>",
"        Disappearance of all target lesions or disappearance of any intratumoral arterial enhancement in all target lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        PR",
"       </td>",
"       <td>",
"        At least 30 percent decrease in the sum of diameters of viable (enhancing) target lesions, taking as a reference the baseline sum of the diameters of target lesions*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        PD",
"       </td>",
"       <td>",
"        Any increase of at least 20 percent in the sum of the diameters of viable target lesions, taking as a reference the smallest sum of the diameters of viable (enhancing) target lesions recorded since treatment started*",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        SD",
"       </td>",
"       <td>",
"        Any cases that do not qualify for either partial response or progressive disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Non-target lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Malignant portal vein thrombosis",
"       </td>",
"       <td>",
"        Should be considered a nonmeasurable lesion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lymph nodes",
"       </td>",
"       <td>",
"        If detected at the porta hepatis, should be considered malignant if the short axis dimension is &ge;2.0 cm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pleural effusions and ascites",
"       </td>",
"       <td>",
"        Emergence of, or increase in, ascites is common during the course of treatment of a cirrhotic patient and may reflect worsening of the underlying chronic liver disease, and be unrelated to cancer progression. The same is true of pleural effusions. Cytopathologic confirmation of the neoplastic nature of any effusion that appears during treatment is required when the measurable tumor has met criteria for response or stable disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        New lesions",
"       </td>",
"       <td>",
"        A newly detected hepatic nodule is classified as hepatocellular carcinoma (and declared evidence of progression) when its longest diameter is at least 1 cm and the nodule has a typical vascular pattern on dynamic imaging (hypervascular in arterial phase with washout in the portal venous or late venous phase). Liver lesions &gt;1 cm that do not show a typical vascular pattern can be diagnosed as hepatocellular carcinoma if there is at least 1 cm internal growth on subsequent scans.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     RECIST: Response Evaluation Criteria In Solid Tumors; CR: complete response; PR: partial response; PD: progressive disease: SD: stable disease.",
"     <br>",
"      * Enhancement in the arterial phase reflects viable tumor tissue.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Lencioni R, et al. Semin Liver Dis 2010: 30:52.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
